import React from 'react';
const DetailHeadless = (PreLayout, LoadDataAsync, ToggleFromDef) => ({ cards: preCards = [], defToggle, asyncCalls, detailCardTitle = "Detail", ...rest }) => {
    const Toggle = ToggleFromDef(defToggle, asyncCalls.updateData);
    const CardDetail = { title: detailCardTitle, Component: Toggle };
    const cards = [CardDetail, ...preCards];
    const def = { ...rest, cards };
    const Layout = PreLayout(def);
    return React.createElement(LoadDataAsync, { getData: asyncCalls.getData, Component: Layout });
};
export default DetailHeadless;
